import React from 'react';
import logo from './logo.svg';
import './App.css';

function DateAndTime() {
  return (
    <div>
      <Time></Time>
    </div>
  )
}

function Welcome() {
  return (
    <div className='Welcome'>
      Welcome to the game.
    </div>
  )
}

function App() {
  return (
    <div className='App'>
      <DateAndTime />
      <Welcome />
    </div>
  );
}

export default App;
